import React from 'react';
import styled from '@emotion/styled';
import { BsChevronDown, BsChevronUp} from 'react-icons/bs';

const SortPanel = () => {
  return (
    <SortPanelStyled>
      <span>
        <BsChevronDown />
      </span>
      <span>
        <BsChevronUp />
      </span>
    </SortPanelStyled>
  );
};

const SortPanelStyled = styled.div``;

export default SortPanel;
